class ImgUtil {
  static Image base642Image(String base64Txt) {
    Uint8List bytes = Base64Decoder().convert(base64Txt);
    return Image.memory(bytes,
     fit: BoxFit.fitWidth,
      gaplessPlayback: true, //防止重绘
    );
  }
}

